import React from 'react';

function Friend(props) {
    <div>

        return <h1>{props.name}</h1>
        return <h1>{props.age}</h1>
    </div>
}

function Image() {
    return (
        <div>
            <Friend name="jm" />
            <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fblogyong.com%2F%25ED%2598%25B8%25EA%25B7%25B8%25EC%2599%2580%25ED%258A%25B8-%25EC%2584%25B1%25EC%2597%2590%25EC%2584%259C-in-usj%2F&psig=AOvVaw2FhTzbjx6nuJqyCyp91Nhq&ust=1629614418823000&source=images&cd=vfe&ved=0CAsQjRxqFwoTCJDnnvvAwfICFQAAAAAdAAAAABAD" />
        </div>
    )
}

export default Image;
